import React from "react";

export default function About() {
  return (
    <div>
      <h2>Peace of mind when you travel with Xplore. That is our motto.</h2>
      <p>
        Xplore is trusted by millions around the world and our reviews are there
        to back it up. We have the most exclusive, stunning, and beautiful stays
        in the whole world.
      </p>
      <br />
      <p>
        Our team is made up of travelling enthusiasts that use Xplore when
        travelling and are always looking to improve your eperience. Our team
        doesn't just want to sell you a product. They want to sell you an
        experience.
      </p>
    </div>
  );
}
